import React from 'react';
import TradingViewWidget, { Themes } from 'react-tradingview-widget';
import '../Tools/live.css';

 
import { MyfxbookApi } from 'myfxbook-api-client';

const Calendar = () => (                           
  <div><script class="powered" type="text/javascript" 
  src="https://widgets.myfxbook.com/scripts/fxCalendar.js"></script>
  <iframe className="fx_calendar" width="300" height="300" src="https://www.myfxbook.com/widgets"></iframe>
  <script type="text/javascript">showTopAutotradeWidget()</script></div>




);
export default Calendar;
